// Search.js

import React from 'react';
import SearchFormContainer from './SearchForm/SearchFormContainer';
import SearchResultsContainer from './SearchResults/SearchResultsContainer';

const Search = props => {
  return(
    <div className="Search">
      <div className="Search__image"></div>
      <div className="Search__title">search title</div>
      <div className="Search__formWrapper">
        <SearchFormContainer
          getSearchResults={props.getSearchResults}
        />
      </div>
      <div className="Search__resultsWrapper">
        <SearchResultsContainer
          unProcessedData={props.unProcessedData}
          clientCoordinates={{ 
            'clientLatitude': props.clientCoordinates.clientLatitude,  
            'clientLongitude': props.clientCoordinates.clientLongitude,  
          }}
        />
      </div>
    </div>
  )
}

export default Search;
